DROP TABLE IF EXISTS `zac_sub_account_detail_payment`;
CREATE TABLE `zac_sub_account_detail_payment` (
  `id` bigint(20) unsigned NOT NULL COMMENT '唯一标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `sub_account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '子账户id',
  `sub_account_detail_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '子账户id',
  `sn` varchar(32) NOT NULL DEFAULT '' COMMENT '支付编号',
  `type` tinyint(4) NOT NULL COMMENT '子账户明细支付类型,code=SUB_ACCOUNT_DETAIL_PAYMENT_TYPE',
  `platform` tinyint(4) NOT NULL DEFAULT '0' COMMENT '子账户明细支付平台,code=SUB_ACCOUNT_DETAIL_PAYMENT_PLATFORM',
  `method` tinyint(4) NOT NULL DEFAULT '0' COMMENT '子账户明细支付方式,code=SUB_ACCOUNT_DETAIL_PAYMENT_METHOD',
  `transaction_no` varchar(50) NOT NULL DEFAULT '' COMMENT '交易流水号（第三方）',
  `payment_date` datetime DEFAULT NULL COMMENT '支付成功日期',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `remark` varchar(512) NOT NULL DEFAULT '' COMMENT '备注信息',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '子账户明细支付状态,code=SUB_ACCOUNT_DETAIL_PAYMENT_STATUS',
  `is_share_pay` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否代付：1，是；2.否',
  `version` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '更新版本号',
  `creator_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `modifier_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '修改人',
  `record_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0无效1有效)',
  PRIMARY KEY (`id`),
  KEY `fk_zac_sub_account_detail_payment_sub_account_id` (`sub_account_id`) USING BTREE,
  KEY `fk_zac_sub_account_detail_payment_sub_account_detail_id` (`sub_account_detail_id`) USING BTREE,
  KEY `fk_zac_sub_account_detail_payment_sn` (`sn`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户中心-子账户明细支付表';

